hebsuperobject.biblemap.put("b18_42_11", new hebsuperobject(18,42,11,"ויבאו אליו כל אחיו וכל אחיתיו וכל ידעיו לפנים ויאכלו עמו לחם בביתו וינדו לו וינחמו אתו על כל הרעה אשר הביא יהוה עליו ויתנו לו איש קשיטה אחת ואיש נזם זהב אחד׃"));
